import React, { Component } from "react";
import AppNavbar from "./appNavbar";
import { Tabs, Radio, Col, Row } from "antd";

const { TabPane } = Tabs;

class SelfInfomation extends Component {
  state = {
    appNavbarWidth: "100%",
    appNavbarHeight: "10%",
    mode: "left",
    avatar_url:
      "https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png"
  };
  render() {
    return (
      <div>
        <div
          style={{
            position: "fixed",
            zIndex: 1,
            width: "100%",
            background: "#f7f7f7"
          }}
        >
          <AppNavbar width={appNavbarWidth} height={appNavbarHeight} />
        </div>
        <div>
          <Row style={{}}>
            <Col span={6} offset={9}>
              <Tabs
                tabPosition={this.state.mode}
                defaultActiveKey="1"
                style={{ height: 550 }}
              >
                <TabPane Tabs="账号信息" key={1}></TabPane>
              </Tabs>
            </Col>
          </Row>
        </div>
      </div>
    );
  }
}

export default SelfInfomation;
